    {
      id: "1",
      title: "Estudar Programação",
      completead: false,
    },

    {
      id: "2",
      title: "Ler Livros",
      completead: true,
    },

    {
      id: "3",
      title: "Tomar água",
      completead: true,
    },


  ]);

  return ( 
  <>
  <div className="container">
    <AddTask />
    <Tasks tasks={tasks}/>
  </div>


  </>

  );

}

export default App;
